import React from "react";
import Footer from "../components/UI/Footer/Footer";
import Navbar from "../components/UI/Navbar/Navbar";
import CardContent from "@mui/material/CardContent";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card";
import { height } from "@mui/system";
const ProductDetails = () => {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <div className="content">
        <h1>Detalles productos</h1>
        <Card sx={{height: "400px", maxWidth: "auto", margin: "0 0 100px 0"}}>
        <CardContent>
        <Grid container>
        <Grid xs={6} className='product-image-container'>
        <CardActionArea>
            <CardMedia
              component="img"
              height="140"
              image={fisrt_product}
              alt="green iguana"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                Vermivet Solución Oral 1l
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Antiparasitario Interno, recomendado para aves, bovino y porcino.
              </Typography>
            </CardContent>
          </CardActionArea>

        </Grid>
        <Grid xs={6} className='product-content-container'>
        <Typography className="product-detail-text" variant="h7" >
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas odio felis, pellentesque eu urna mollis, dignissim consectetur tortor. Vestibulum sed imperdiet odio. Vestibulum eu nunc sed velit volutpat venenatis. Praesent et sodales orci. Pellentesque luctus orci non maximus varius. Etiam ut orci ante. Suspendisse imperdiet tempus sem, in facilisis felis suscipit in. Integer ac lacinia leo. Aenean pulvinar bibendum eros, vel placerat tortor mattis quis. In mi leo, tempor eu nisl at, suscipit feugiat felis. Etiam fermentum arcu ac lacus maximus, eget venenatis lectus suscipit. Cras sed suscipit felis, quis ultricies nibh. Maecenas dapibus hendrerit lorem, quis porttitor mauris commodo at. Mauris ut vulputate neque. Morbi fermentum, odio at vestibulum dictum, nibh neque vestibulum est, tempor gravida turpis justo quis nunc.
        </Typography>
        </Grid>
        </Grid>
        </CardContent>
        </Card>
      </div>
      <footer>
        <Footer />
      </footer>
    </div>
  );
};

export default ProductDetails;
